import React from "react";
import TopLogo from "./TopLogo";
import Footer from "./Footer";
import SearchBar from "./SearchBar";
import MealItemsList from "./MealItemsList";

import topLogo from "../images/BackgroundFood.png";
import mealImage from "../images/Burger_Fries.png";

const MealPage = () => {
  return(
    <div>
      <div className="page-container">
        <TopLogo displayImage={topLogo}/>
        <SearchBar />
        <MealItemsList displayInfo={displayInfo}/>
        <Footer />
      </div>
    </div>
  );
}

const displayInfo = [
  {
    title: "Southern Fried Chicken",
    image: mealImage,
    url: "/meals"
  },
  {
    title: "Road-Side Burger",
    image: mealImage,
    url: "/sides"
  },
  {
    title: "Srimp Crits",
    image: mealImage,
    url: "/drinks"
  },
  {
    title: "Desserts",
    image: mealImage,
    url: "/desserts"
  }
];

export default MealPage;
